        { id: 2, message: 'Hello' , likequantity: 23},
        { id: 3, message: 'you' , likequantity: 23},
        { id: 3, message: 'Yo' , likequantity: 23},
        { id: 5, message: 'Good bay' , likequantity: 23},
        { id: 6, message: 'Lose' , likequantity: 23}
        ]

        let postsElements = postsData.map(p => <Post message={p.message} likequantity={p.likequantity}/>)

    return (
        <div className={s.postsBlock}>
            <h3>My post</h3>
            <div><textarea></textarea></div>

            <button>Add post</button>
            <div className={s.posts}>
                <Post message={postsData[3].message} likequantity={postsData[3].likequantity}/>
            </div>
        </div>
    );
}

export default MyPosts;
